      "icon": "Purge.png",
      "blurb": "<span class=\"template_sbc\"><b>Active:</b></span> For a few seconds, <b>Urgot</b> becomes <span data-game=\"lol\" data-tip=\"Ghosted\" class=\"glossary\" style=\"white-space:pre; position:relative;\"><a title=\"Unit collision\" href=\"/wiki/Unit_collision\"><img src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" data-relevant=\"0\" alt=\"Ghost\" decoding=\"async\" width=\"20\" height=\"20\" data-image-key=\"Ghost.png\" loading=\"lazy\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/a/ab/Ghost.png/revision/latest/scale-to-width-down/20?cb=20180514003209\" class=\"lazyload\" data-image-name=\"Ghost.png\"></a> <a title=\"Unit collision\" href=\"/wiki/Unit_collision\">ghosted</a></span> and autonomously attacks the nearest enemy at a <span style=\"white-space:nowrap\"><a href=\"/wiki/Attack_speed\" title=\"Attack speed\"><img data-relevant=\"0\" data-image-name=\"Attack speed icon.png\" decoding=\"async\" height=\"15\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/9/91/Attack_speed_icon.png/revision/latest/scale-to-width-down/15?cb=20170515203443\" alt=\"Attack speed icon\" class=\"lazyload\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" loading=\"lazy\" width=\"15\" data-image-key=\"Attack_speed_icon.png\"></a>&nbsp;<span style=\"color:orangered; white-space:normal\"><b>fixed</b> attack speed</span></span>, prioritizing the <i>marked</i> enemy. <i>Purge</i> can be recast within the duration, and does so automatically afterwards.",
