  "notes": "* <b>Urgot</b> turns around when tossing an enemy over him, always facing his victim.\n<ul><li>The target will be <span style=\"white-space:pre; position:relative;\" class=\"glossary\" data-tip=\"Airborne\" data-game=\"lol\"><a href=\"/wiki/Airborne\" title=\"Airborne\"><img data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/d/d6/Airborne_icon.png/revision/latest/scale-to-width-down/20?cb=20171201223933\" class=\"lazyload\" data-image-name=\"Airborne icon.png\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" alt=\"Airborne icon\" width=\"20\" height=\"20\" loading=\"lazy\" decoding=\"async\" data-image-key=\"Airborne_icon.png\" data-relevant=\"0\"></a> <a href=\"/wiki/Airborne\" class=\"mw-redirect\" title=\"Airborne\">flung</a></span> to the location behind <b>Urgot</b> over 0.<small>5</small> seconds given that they do not move nor are moved from the position at which they collided with him while <span class=\"glossary\" data-tip=\"Stun\" style=\"white-space:pre; position:relative;\" data-game=\"lol\"><a href=\"/wiki/Stun\" title=\"Stun\"><img width=\"20\" data-relevant=\"0\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" data-image-name=\"Stun icon.png\" height=\"20\" alt=\"Stun icon\" data-image-key=\"Stun_icon.png\" loading=\"lazy\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/9/9d/Stun_icon.png/revision/latest/scale-to-width-down/20?cb=20171201223940\" class=\"lazyload\" decoding=\"async\"></a> <a href=\"/wiki/Stun\" title=\"Stun\" class=\"mw-redirect\">stunned</a></span>.</li>\n<li><i>Disdain</i> prevents <span data-param=\"\" data-champion=\"Urgot\" data-ability=\"Purge\" style=\"display:inline;white-space:pre;\" data-game=\"lol\" class=\"inline-image label-after ability-icon\"><span style=\"display:inline-block;position:relative;\" class=\"border\" data-width=\"20\"><a href=\"/wiki/Urgot/LoL#Purge\" title=\"Purge\"><img decoding=\"async\" data-image-name=\"Urgot Purge.png\" data-image-key=\"Urgot_Purge.png\" height=\"20\" alt=\"Purge\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" width=\"20\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/0/07/Urgot_Purge.png/revision/latest/scale-to-width-down/20?cb=20170715224516\" loading=\"lazy\" class=\"thumbborder lazyload\" data-relevant=\"0\"></a></span> <span style=\"white-space:normal;\"><a title=\"Urgot/LoL\" href=\"/wiki/Urgot/LoL#Purge\">Purge</a></span></span> from firing for 1.<small>25</small> seconds.</li>\n<li>The range indicator length is 475 units, but the dash only moves <b>Urgot</b> 450 units.</li>\n<li>This ability will cast from wherever the caster is at the end of the cast time.</li>\n<li>The <span class=\"glossary\" style=\"white-space:pre; position:relative;\" data-game=\"lol\" data-tip=\"Shield\"><a href=\"/wiki/Shield\" title=\"Shield\"><img alt=\"Hybrid resistances icon\" data-image-key=\"Hybrid_resistances_icon.png\" width=\"20\" loading=\"lazy\" data-relevant=\"0\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/5/55/Hybrid_resistances_icon.png/revision/latest/scale-to-width-down/20?cb=20170516021237\" data-image-name=\"Hybrid resistances icon.png\" decoding=\"async\" height=\"20\" class=\"lazyload\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\"></a> <a title=\"Shield\" href=\"/wiki/Shield\">shield</a></span> is granted at the start of the cast time while the <span style=\"white-space:pre; position:relative;\" class=\"glossary\" data-game=\"lol\" data-tip=\"Dash\"><a title=\"Dash\" href=\"/wiki/Dash\"><img src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" decoding=\"async\" alt=\"Dash\" height=\"20\" data-image-key=\"Dash.png\" width=\"20\" loading=\"lazy\" data-relevant=\"0\" class=\"lazyload\" data-image-name=\"Dash.png\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/5/55/Dash.png/revision/latest/scale-to-width-down/20?cb=20180514002826\"></a> <a title=\"Dash\" href=\"/wiki/Dash\">dash</a></span> begins after.</li>\n<li>The <span data-tip=\"Airborne\" data-game=\"lol\" class=\"glossary\" style=\"white-space:pre; position:relative;\"><a title=\"Airborne\" href=\"/wiki/Airborne\"><img src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" alt=\"Airborne icon\" decoding=\"async\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/d/d6/Airborne_icon.png/revision/latest/scale-to-width-down/20?cb=20171201223933\" class=\"lazyload\" data-image-name=\"Airborne icon.png\" data-relevant=\"0\" height=\"20\" width=\"20\" loading=\"lazy\" data-image-key=\"Airborne_icon.png\"></a> <a class=\"mw-redirect\" href=\"/wiki/Airborne\" title=\"Airborne\">fling</a></span> will occur after 0.<small>25</small> seconds regardless of how far away the target is.</li>\n<li><span data-tip=\"Displacement immunity\" data-game=\"lol\" class=\"glossary\" style=\"white-space:pre; position:relative;\"><a href=\"/wiki/Crowd_control#Displacement_Immunity\" title=\"Crowd control\"><img data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/4/42/Unstoppable_icon.png/revision/latest/scale-to-width-down/20?cb=20171207164427\" decoding=\"async\" data-image-key=\"Unstoppable_icon.png\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" data-image-name=\"Unstoppable icon.png\" class=\"lazyload\" alt=\"Unstoppable icon\" height=\"20\" width=\"20\" loading=\"lazy\" data-relevant=\"0\"></a> <a title=\"Crowd control\" href=\"/wiki/Crowd_control#Displacement_Immunity\">Displacement immunity</a></span> will not resist the application of the <span style=\"white-space:pre; position:relative;\" data-tip=\"Stun\" data-game=\"lol\" class=\"glossary\"><a href=\"/wiki/Stun\" title=\"Stun\"><img data-image-key=\"Stun_icon.png\" class=\"lazyload\" height=\"20\" decoding=\"async\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/9/9d/Stun_icon.png/revision/latest/scale-to-width-down/20?cb=20171201223940\" width=\"20\" data-relevant=\"0\" data-image-name=\"Stun icon.png\" loading=\"lazy\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" alt=\"Stun icon\"></a> <a class=\"mw-redirect\" title=\"Stun\" href=\"/wiki/Stun\">stun</a></span>.</li></ul>",
