  "affects": "Enemies",
  "damagetype": "<span data-tip=\"Physical damage\" data-game=\"lol\" style=\"white-space:pre; position:relative;\" class=\"glossary\"><a href=\"/wiki/Physical_damage\" title=\"Physical damage\"><img data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/0/07/Attack_damage.png/revision/latest/scale-to-width-down/20?cb=20170514064911\" alt=\"Attack damage\" loading=\"lazy\" height=\"20\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" data-image-name=\"Attack damage.png\" data-relevant=\"0\" data-image-key=\"Attack_damage.png\" decoding=\"async\" width=\"20\" class=\"lazyload\"></a> <a title=\"Physical damage\" href=\"/wiki/Physical_damage\">Physical</a></span> / <span class=\"glossary\" data-game=\"lol\" style=\"white-space:pre; position:relative;\" data-tip=\"True damage\"><a href=\"/wiki/True_damage\" title=\"True damage\"><img data-image-key=\"Hybrid_penetration.png\" class=\"lazyload\" data-image-name=\"Hybrid penetration.png\" height=\"20\" alt=\"Hybrid penetration\" decoding=\"async\" src=\"data:image/gif;base64,R0lGODlhAQABAIABAAAAAP///yH5BAEAAAEALAAAAAABAAEAQAICTAEAOw%3D%3D\" width=\"20\" data-relevant=\"0\" data-src=\"https://static.wikia.nocookie.net/leagueoflegends/images/9/92/Hybrid_penetration.png/revision/latest/scale-to-width-down/20?cb=20170514081634\" loading=\"lazy\"></a> <a title=\"True damage\" href=\"/wiki/True_damage\">True</a></span>",
